import React, { useState } from "react";
import "./App.css";
import { ethers } from "ethers";
import StudentABI from "./StudentABI.json";
import Papa from "papaparse";

function App() {
  const [provider, setProvider] = useState(null);
  const [contract, setContract] = useState(null);
  const [studentId, setStudentId] = useState("");
  const [newStudentId, setNewStudentId] = useState("");
  const [newStudentName, setNewStudentName] = useState("");
  const [message, setMessage] = useState("");
  const [csvResults, setCsvResults] = useState([]);

  const contractAddress = "0x5A356b0EBeDFcb63643353dEE1B36F48dE886dd0";
  const contractABI = StudentABI;

  async function connectToEthereum() {
    try {
      if (window.ethereum) {
        const provider = new ethers.providers.Web3Provider(window.ethereum);
        await window.ethereum.request({ method: "eth_requestAccounts" });
        setProvider(provider);

        const contract = new ethers.Contract(
          contractAddress,
          contractABI,
          provider.getSigner()
        );
        setContract(contract);
      } else {
        alert("Please install MetaMask or use a Web3-enabled browser.");
      }
    } catch (error) {
      alert("Error connecting to Ethereum:", error);
    }
  }

  async function getStudent() {
    try {
      if (contract) {
        const result = await contract.getStudent(studentId);
        setMessage(`Student ID: ${result[0]}, Name: ${result[1]}`);
      } else {
        alert("Contract not initialized.");
      }
    } catch (error) {
      alert("Error getting student:", error);
    }
  }

  async function addStudent() {
    try {
      if (contract) {
        const tx = await contract.addStudent(newStudentId, newStudentName);
        await tx.wait();
        setMessage("Student minted successfully.");
        getStudent(result);
        setMessage(`Student ID: ${result[0]}, Name: ${result[1]}`);
      } else {
        alert("Contract not initialized.");
      }
    } catch (error) {
      alert("Error adding student:", error);
    }
  }

  async function handleFileUpload(event) {
    const file = event.target.files[0];

    if (!file) {
      return;
    }

    const results = await new Promise((resolve) => {
      Papa.parse(file, {
        header: true,
        skipEmptyLines: true,
        complete: (results) => {
          resolve(results.data);
        },
        error: (error) => {
          console.error("CSV Parsing Error:", error.message);
          resolve([]);
        },
      });
    });
    setCsvResults(results);
  }
  async function processCSVData() {
    try {
      if (contract) {
        for (const student of csvResults) {
          const { id, name } = student;
          const tx = await contract.addStudent(id, name);
          await tx.wait();
        }
        setMessage("Bulk upload successful");
      } else {
        alert("Contract not initialized.");
      }
    } catch (error) {
      console.error("Error adding students:", error);
      alert("Error adding students. Check the console for more details.");
    }
  }

  async function getAllStudents() {
    try {
      if (contract) {
        const totalStudents = await contract.methods.totalStudents().call();
        const studentDetails = [];

        for (let i = 0; i < totalStudents; i++) {
          const studentId = i;
          const result = await contract.methods.getStudent(studentId).call();
          studentDetails.push(`Student ID: ${result[0]},Name: ${result[1]}`);
        }

        // Now, studentDetails array contains details of all students
        setMessage(studentDetails);
      } else {
        alert("Contract not initialized.");
      }
    } catch (error) {
      console.error("Error getting students:", error);
      alert("Error getting students. Check the console for more details.");
    }
  }

  return (
    <div className="App">
      <br />
      <hr />
      <button onClick={connectToEthereum}>Connect-Wallet</button>
      <hr /> <h1>Issuances</h1>
      <div>
        <h2>Bulk upload</h2>
        <input type="file" accept=".csv" onChange={handleFileUpload} />
        <button onClick={processCSVData}>Add Student</button>
        <br />
        <br />
        <h2>Single upload</h2>
        <label>Student ID: </label>
        <input
          type="number"
          value={newStudentId}
          onChange={(e) => setNewStudentId(e.target.value)}
        />
        <br />
        <br />
        <label>Student Name: </label>
        <input
          type="text"
          value={newStudentName}
          onChange={(e) => setNewStudentName(e.target.value)}
        />
        <br />
        <br />
        <button onClick={addStudent}>Add Student</button>
      </div>
      <hr />
      <h1>Verification</h1>
      <div>
        <label>Student ID: </label>
        <input
          type="number"
          value={studentId}
          onChange={(e) => setStudentId(e.target.value)}
        />
        <br />
        <br />
        <button onClick={getStudent}>Get Student</button>
        {/* <button onClick={getAllStudents}>Get All Students</button> */}
      </div>
      <div>
        <p>{message}</p>
      </div>
      <hr />
    </div>
  );
}

export default App;
